import { Component } from '@angular/core';
import { TrainerService } from 'src/app/services/trainer.service';

@Component({
  selector: 'app-trainer-register',
  templateUrl: './trainer-register.component.html',
  styleUrls: ['./trainer-register.component.css']
})
export class TrainerRegisterComponent {
  showSecound = false;
  loginError= false;

  member: Member = {
    memberId: 0,
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    gender: '',
    mobileNo: '',
    forgetPasswordAnswer: '',
    confirmPassword: ''
  };

  constructor(private R: TrainerService, private router: Router) {}

  onSubmit() {
      this.memberService.insertMember(this.member).subscribe({
        next:(value)=> {
          console.log(value)
            this.router.navigate(['/login'])
        },
        error:(err)=>{
            console.log(err)
        },
      })    
  }

  onNext() {
   this.memberService.checkMemberEmail(this.member).subscribe({
    next:(value)=>{
       if(value){
        this.showSecound= true;
      }
      // alert("The Email You Enter That Already Exits!!")
      this.loginError = true
    },
    error:(err)=>{
      this.showSecound  = true
        console.log(err)
    },
   })


  }
}
